'''
Removing
    - "ab" gives x points
    - "ba" gives y points

Does it exists the case where we need to remove a word with less pioints to get a word with more points?

First we will remove all the cases that contains de highest points, then we will remove the lowest points.


New optimization process, split the list first in the max paing points word, count the blank spaces and multiply by the point for that combination
'''


class Solution:
    def maximumGain(self, s:str, x:int, y:int) -> int:
        
        points = 0
        highest_paying_word = "ab" if x>=y else "ba"
        lowest_paying_word = "ab" if x<y else "ba"
        while "ab" in s or "ba" in s:
            while highest_paying_word in s:
                points += max(x, y)
                s = s[:s.index(highest_paying_word)] + s[s.index(highest_paying_word)+2:]

            while lowest_paying_word in s:
                points += min(x, y)
                s = s[:s.index(lowest_paying_word)] + s[s.index(lowest_paying_word)+2:]
        return points
    




import time
sol = Solution()
x = 8116
y = 8868

test_s = ""

print(test_s.split("ba"))
start = time.time()
print(sol.maximumGain(test_s, x, y)) # 19
end = time.time()

print(end-start)